import React, { Component } from 'react';

class DataAndExtractLink extends Component {
  async componentDidMount() {
    try {
      const response = await fetch('https://api.adkey-seo.com/api/website/get-website/295');
      const data = await response.json();

      if (data.offers && data.offers.length > 0) {
        const link = data.offers[0].link;
        console.log('Перший елемент масиву "offers" містить посилання:', link);
      } else {
        console.log('Поле "offers" порожнє або відсутнє в отриманих даних.');
      }
    } catch (error) {
      console.error('Помилка при виконанні запиту:', error);
    }
  }

  render() {
    // Додайте ваш JSX тут, якщо потрібно відображення компонента
    return <div>Додайте ваш вміст JSX тут</div>;
  }
}

